(6, '197203061992031001', '199110222013101001', '197203061992031001', '197410171995112001', 'SPD-006/WPJ.16/KP.02/2020', '2020-01-10', 'Dalam rangka melaksanakan Pelatihan Teknis Pembekalan Pejabat Pengawas Angkatan I dan II TA 2020 sesuai PENG-342/PJ.01/2020 tanggal 23 Desember 2019', 'Angkutan Udara', 2, '2020-01-11', '152', '', '', '', '2020-01-18', '0008', '2020-01-10', 530000, 2, 1060000, 20, 0, NULL, 0, 0, 848000, 0, 0, 0, 0, NULL, NULL, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 848000, 0, 0, 848000, 0, 4, '2020-02-12', NULL, 'LS KPPN', 994, '                     Bertemu dengan Bendahara Satker Pelaksanaan Jalan Nasional Wilayah Propinsi Gorontalo Jhon WF Ottay dan menjelaskan beberapa Perusahaan pemenang lelang di satker tersebut telah menggunakan NPWP Gorontalo namun belum dikukuhkan sebagai Pengusaha Kena Pajak (PKP) sedangkan nilai tender yang dimenangkan telah melebihi 4.800.000.000. Untuk itu dihimbau kepada perusahaan-perusahaan tersebut untuk mendaftarkan diri sebagai PKP di KPP Pratama Gorontalo atau akan dikukuhkan secara jabatan sebagai PKP di KPP Pratama Gorontalo<br>', NULL, 0),
