ggalian potensi-potensi perpajakan. Pada hari\r\nkedua kegiatan dilanjutkan dengan materi pembahasan WP yang di usulkan untuk\r\nIDLP. Pada hari terakhir materi tentang Prosedur dan Aspek Hukum Forensik Digital\r\ndalam kegiatan Pemeriksaan dilanjutkan <i>dengan\r\nSharing Session </i>Kepala KPP Pratama Bitung diakhir acara seluruh peserta\r\nmengikuti Apel Siaga Penegakan Hukum dan Pengarahan dari Bapak Tri Wibowo\r\nselaku Kepala Kanwil Sulut Tenggo Malut diakhiri dengan Penandatangan Fakta\r\nIntegiritas pencapaian IKU tahun 2020.     <o></o></span></sup></p>                     ', NULL, 0),
