(256, '197203061992031001', '199110222013101001', '197203061992031001', '197607062002121001', 'SPD-00136/WPJ.16/KP.02/2020', '2020-03-04', 'Dalam rangka melakukan pengujian lapangan di tempat Wajib Pajak sesuai Surat Perintah Pemeriksaan', 'Angkutan Darat', 1, '2020-03-05', '131', '', '', '', '2020-03-05', '0122', '2020-03-04', 370000, 1, 370000, 20, 0, NULL, NULL, NULL, 296000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 296000, 0, 0, 296000, 0, 4, '2020-07-08', NULL, 'LS BEND', 501, '                     Sehubungan dengan Surat Tugas Nomor ST-122/WPJ.16/KP.02/2020 tanggal 4 Maret 2020 tentang tugas pengujian lapangan di tempat Wajib Pajak atas nama Fatma Badu dan Eron Bobihe dengan ini disampaikan Laporan Pelaksanaan Tugas sebagai berikut:<br><br> Sasaran dari kegiatan ini adalah Tim Pemeriksa bertemu dengan Wajib Pajak/Wakil dan melaksanakan administrasi sehubungan dengan pemeriksaan yaitu pengujian langsung di tempat Wajib Pajak.<br><br> Tim Pemeriksa melakukan perjalanan ke alamat Wajib Pajak. Wajib Pajak bertemu dengan Fatma Badu yang beralamat di Jl Pelabuhan Anggrek, Pontolo, Gorontalo Utara. Kemudian Tim Pemeriksa melakukan perjalanan ke alamat Eron Bobihoe yang beralamat di Jl. Beringin II Lingkungan I, Kayubulan Limboto, Kab. Gorontalo. Tim Pemeriksa bertemu dengan Eron Bobihoe.<br><br> Tidak terdapat kendala dalam pelaksanaan tugas.<br><br> Kegiatan pengujian lapangan di tempat Wajib Pajak telah dilaksanakan dengan baik. Tim Pemeriksa telah bertemu secara langsung oleh Wajib Pajak/wakil WP dan menunggu dokumen yang diminta pada saat pertemuan untuk disampaikan ke KPP.<br><br>', NULL, 0);
