oNormal\" xss=removed><span lang=\"EN-US\" xss=removed><o> </o></span><span xss=removed>Tidak terdapat kendala dalam pelaksanaan\r\ntugas.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed><o> </o></span><span lang=\"EN-US\" xss=removed>Kegiatan pengujian lapangan di tempat Wajib\r\nPajak telah dilaksanakan dengan baik. </span><span xss=removed>Tim\r\nPemeriksa</span><span lang=\"EN-US\" xss=removed> telah bertemu secara langsung oleh Wajib Pajak/wakil\r\nWP dan</span><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>menunggu\r\ndokumen yang diminta pada saat pertemuan untuk disampaikan ke KPP</span><span xss=removed>.</span></p>', NULL, 0),
