49\" Name=\"List Table 4 Accent 6\">\r\n  <w Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\">\r\n  <w Locked=\"false\" Priority=\"51\" Name=\"List Table 6 Colorful Accent 6\">\r\n  <w Locked=\"false\" Priority=\"52\" Name=\"List Table 7 Colorful Accent 6\">\r\n  <w Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\" Name=\"Mention\">\r\n  <w Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\" Name=\"Smart Hyperlink\">\r\n  <w Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\" Name=\"Hashtag\">\r\n  <w Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\" Name=\"Unresolved Mention\">\r\n  <w Locked=\"false\" SemiHidden=\"true\" UnhideWhenUsed=\"true\" Name=\"Smart Link\">\r\n </w>\r\n&lt;/xml&gt;&lt;![endif]--&gt;&lt;!--[if gte mso 10]>\r\n&lt;style&gt;\r\n /* Style Definitions */\r\n table.MsoNormalTable\r\n {mso-style-name:\"Table Normal\";\r\n mso-tstyle-rowband-size:0;\r\n mso-tstyle-colband-size:0;\r\n mso-style-noshow:yes;\r\n mso-style-priority:99;\r\n mso-style-parent:\"\";\r\n mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\r\n mso-para-margin:0cm;\r\n mso-para-margin-bottom:.0001pt;\r\n mso-pagination:widow-orphan;\r\n font-size:10.0pt;\r\n font-family:\"Times New Roman\",serif;\r\n mso-ansi-language:IN;\r\n mso-fareast-language:IN;}\r\n&lt;/style&gt;\r\n&lt;![endif]--&gt;\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed lang=\"IN\">Sehubungan dengan Surat\r\nTugas Nomor ST-</span><span xss=removed>123</span><span xss=removed lang=\"IN\">/WPJ.16/KP.0</span><span xss=removed>2</span><span xss=removed lang=\"IN\">/20</span><span xss=removed>20 tanggal 4 Maret\r\n2020 tentang tugas pengujian lapangan di tempat Wajib Pajak atas nama SMP Muh.\r\nBatudaa dengan ini disampaikan Laporan Pelaksanaan Tugas sebagai berikut:</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Sasaran dari kegiatan ini adalah Tim Pemeriksa bertemu\r\ndengan Wajib Pajak/Wakil</span><span xss=removed> </span><span xss=removed>dan melaksanakan administrasi\r\nsehubungan dengan pemeriksaan yaitu pengujian langsung di tempat Wajib Pajak.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><sup><span xss=removed> </span></sup></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Tim Pemeriksa melakukan perjalanan ke alamat Wajib\r\nPajak. Wajib Pajak bertemu dengan wakil dari SMP Muh. Batudaa yang beralamat di\r\nJl Hasanudin No.208, Batudaa, Payunga, Batudaa, Kab.Gorontalo. Tim Pemeriksa\r\nbertemu dengan Robiana H. Biahimo selaku bendahara SMP Muh. Batudaa.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Tidak terdapat kendala dalam pelaksanaan tugas.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Kegiatan pengujian lapangan di tempat Wajib Pajak\r\ntelah dilaksanakan dengan baik. </span><span xss=removed lang=\"IN\">Tim Pemeriksa</span><span xss=removed> telah\r\nbertemu secara langsung oleh Wajib Pajak/wakil WP dan</span><span xss=removed> </span><span xss=removed>menunggu dokumen yang diminta pada saat pertemuan untuk disampaikan ke\r\nKPP</span><span xss=removed lang=\"IN\">.</span><span xss=removed></span></p>\r\n\r\n', NULL, 0),
(261, '197203061992031001', '199110222013101001', '197906022000121002', '199904172019121003', 'SPD-00141/WPJ.16/KP.02/2020', '2020-03-06', 'Dalam rangka Pelatihan Dasar (Latsar) bagi CPNS Kementerian Keuangan Golongan II Periode II TA 2020 sesuai PENG-54/PP.2/2020 tanggal 13 Februari 2020', 'Angkutan Udara', 2, '2020-03-09', '267', '', '', '', '2020-03-18', '0125', '2020-03-04', 370000, 2, 740000, 20, 0, NULL, NULL, NULL, 592000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 592000, 0, 0, 592000, 0, 4, '2020-06-10', NULL, 'LS BEND', 994, '           <p xss=removed><span xss=removed>Melaksanakan kegiatan pelatihan dasar CPNS Kementerian Keuangan\r\nPeriode II Golongan II di Balai Diklat Keuangan Manado.<o></o></span></p><p xss=removed><span xss=removed>Pelaksanaan\r\ndari kegiatan tersebut berupa penerapan prinsip bela negara dan nasionalisme\r\nserta penerapan nilai-nilai Kementerian Keuangan dan nilai-nilai ANEKA.<o></o></span></p><p xss=removed><span xss=removed>Kendala\r\ndari pelaksanaan kegiatan pelatihan dasar tersebut adalah mewabahnya virus\r\nCOVID-19 sehingga berpengaruh juga terhadap keputusan penyelenggaraan pelatihan\r\ndasar di Balai Diklat tersebut. Adapun solusinya yaitu dipulangkannya siswa\r\nmenuju instansi tempat mereka masing-masing bekerja mulai tanggal 18 Maret\r\n2020, tepat seminggu setelah pelaksanaan kegiatan pelatihan dasar digelar.\r\nSelanjutnya, kegiatan pelatihan dasar CPNS Kementerian Keuangan Periode II\r\nGolongan II dilaksanakan secara online melalui aplikasi pihak ketiga, yaitu\r\nzoom.<o></o></span></p><p xss=\"removed\">\r\n\r\n\r\n\r\n\r\n\r\n</p><p xss=removed><span xss=removed>Pelaksanaan\r\nkegiatan pelatihan dasar tersebut merupakan sebuah hal yang penting, di mana\r\nkegiatan tersebut diharapkan menjadi pondasi dalam melaksanakan kewajiban di\r\nmasing-masing instansi agar sesuai dengan nilai-nilai di Kementerian\r\nKeuangan <o></o></span></p>                               ', NULL, 0),
