(266, '197203061992031001', '199110222013101001', '197411181994032001', '198302222003121001', 'SPD-00146/WPJ.16/KP.02/2020', '2020-03-06', 'Dalam rangka menghadiri Undangan Sosialisasi dan Bimbingan Teknis Kebijakan Pengawasan dan Pemeriksaan Wajib Pajak sehubungan dengan Perluasan Basis Pajak sesuai Nota Dinas UND-63/PJ.01/2020 tanggal 04 Maret 2020', 'Angkutan Udara', 6, '2020-03-09', '254', '', '', '', '2020-03-14', '0130', '2020-03-06', 430000, 6, 2580000, 20, 0, 0, 0, 0, 2064000, 697000, 697000, 1394000, 5, '2020-03-09', '2020-03-14', 604672, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 3023360, 0, 0, 0, 0, 0, NULL, 6481360, 5917360, 0, 564000, 0, 4, '2020-06-10', NULL, 'LS BEND', 994, '           <p>                                          Sosialisasi dan Bimbingan Teknis tentang Kebijakan Pengawasan dan Pemeriksaan dalam rangka Perluasan Basis Pajak yang diselenggarakan di Gedung Keuangan II Makassat telah berjalan dengan baik dan lancar. Materi yang disampaikan adalah sebagai berikut :</p><p>1. Overview Surat Edaran dan Proses Bisnis Pengawasan WP Strategis.</p><p>2. Proses Bisnis Pengawasan WP Lainnya dan KPDL.</p><p>3. LHPt dan KKPt.</p><p>4. CRM.</p><p>5. Analisis Laporan Keuangan dan SPT Tahunan.</p><p>6. Transfer Pricing.</p><p>7. Analisis Data internal & eksternal DJP.</p><p>8. Aspek Perpajakan Internasional.<br></p><p><br></p>          ', NULL, 0),
