(306, '197203061992031001', '199110222013101001', '197203061992031001', '197410171995112001', 'SPD-00177/WPJ.16/KP.02/2020', '2020-03-11', 'Dalam rangka Pelaksanaan Bimbingan Teknis Pengelolaan Kinerja dan Sosialisasi Manual IKU Unit Vertikal DJP Tahun 2020 sesuai Nota Dinas Kepala Kantor Wilayah Suluttenggomalut nomor ND-328/WPJ.16/KP.02/2020 tanggal 10 Maret 2020', 'Angkutan Darat', 3, '2020-03-11', '155', '', '', '', '2020-03-14', '0145', '2020-03-10', 530000, 3, 1590000, 20, 0, 0, 0, 0, 1272000, 476100, 476100, 952200, 2, '2020-03-11', '2020-03-13', 711207, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 1422414, 100000, 150000, 0, 0, 250000, NULL, 3896614, 2374614, 0, 1522000, 0, 4, '2020-06-10', NULL, 'LS BEND', 994, '           Telah dilaksanakan tugas memenuhi undangan Kepala Kanwil DJP Suluttenggo dan Malut Nomor ND-328/WPJ.16/KP.02/2020 tanggal 10 Maret 2020 tentang Pelaksanaan Bimbingan Teknis Pengelolaan Kinerja dan Sosialisasi Manual IKU Unit Vertikal DJP Tahun 2020 melalui Surat Tugas ini. Pada Bimtek yang diadakan di Kanwil DJP Jakarta Utara ini, dihadiri dari Bagian Organisasi dan Tata Laksana, Direktorat Potensi Kepatuhan dan Penerimaan, dan Direktorat Ekstensifikasi Penilaian. Peserta yang hadir adalah MMKO dan AKO dari Kanwil DJP Bengkulu dan Lampung , Kanwil DJP Sumatera Selatan dan Kepulauan Bangka Belitung, Kanwil DJP Suluttenggo dan Malut , dan Kanwil DJP Jakarta Utara.<br>Pada Hari pertama Kamis 12 Maret 2020, materi yang diberikan adalah mengenai pengelolaan kinerja. Tidak ada perubahan untuk pengelolaan kinerja masih menggunakan aturan PER-12/PJ/2018 tentang Pengelolaan Kinerja di Lingkungan DJP dan KMK-467/KMK.01/2014 tentang Pengelolaan Kinerja di Lingkungan Kemenkeu, dan perubahannya (KMK-556/KMK.01/2015). Materi yang diajarkan antara lain Peta Konsep Penurunan Visi dan Misi Kemenkeu ke Renstra DJP 2020-2024 lalu Renja DJP 2020 lalu dijabarkan ke Sasaran Strategis yang dianalisis melalui Manajemen Risiko lalu dilakukan upaya mitigasi melalui Inisiatif Strategis dan selanjutnya masuk ke Pengelolaan Kinerja yang didalamnya ada IKU yang digunakan sebagai indikator capaian Sasaran Strategis dan Alat untuk mencapai Inisiatif Strategis. IKU akan dibahas pada DKO dengan alur berputar antara planning, managing, dan evaluating sesuai KMK-590/KMK.01/2016, KMK-467/KMK.01/2014, dan PP-46/2011 yang hasilnya berupa NKO untuk organisasi dan NKP (E-performance) dan NPKPNS (Sikka) untuk individu. Selain itu diberikan materi sekilas mengenai Strategi, Balance Scorecard, Peta Strategi Kemenkeu, Sasaran Strategis, Indikator Kinerja Utama,  Manual IKU, NKO, dan Kontrak Kinerja.<br>Pada Hari kedua Jumat 13 Maret 2020, materi yang diberikan adalah mengenai Manual IKU 2020 dan  perubahan-perubahan significant IKU yang dilakukan pada 2020.  Salah satu IKU yang dibahas yaitu Persentase Tingkat Kepatuhan Penyampaian SPT Tahunan PPH Wajib Pajak Badan dan Orang Pribadi. Penetuan Target SPT berdasarkan data antara lain WP Wajib SPT 2019 yang menyampaikan SPT di 2019 dan masih aktif , WP OP Karyawan berpenghasilan dibawah PTKP tapi menyampaikan SPT di 2019 (Non NE-DE) , WP Aktif ada data dan Belum Menyampaikan SPT di 2019, dan WP Baru (Perkiraan 28%). Dengan Rekomendasi Aksi yang dijabarkan juga pada Bimtek ini seperti Mendorong perluasan implementasi KSWP dan Melaksanakan pekan panutan penyampaian SPT bersama para tokoh masyarakat.                                                    ', NULL, 0),
