Risiko lalu dilakukan upaya mitigasi melalui Inisiatif Strategis dan selanjutnya masuk ke Pengelolaan Kinerja yang didalamnya ada IKU yang digunakan sebagai indikator capaian Sasaran Strategis dan Alat untuk mencapai Inisiatif Strategis. IKU akan dibahas pada DKO dengan alur berputar antara planning, managing, dan evaluating sesuai KMK-590/KMK.01/2016, KMK-467/KMK.01/2014, dan PP-46/2011 yang hasilnya berupa NKO untuk organisasi dan NKP (E-performance) dan NPKPNS (Sikka) untuk individu. Selain itu diberikan materi sekilas mengenai Strategi, Balance Scorecard, Peta Strategi Kemenkeu, Sasaran Strategis, Indikator Kinerja Utama,  Manual IKU, NKO, dan Kontrak Kinerja.</p><p>Pada Hari kedua Jumat 13 Maret 2020, materi yang diberikan adalah mengenai Manual IKU 2020 dan  perubahan-perubahan significant IKU yang dilakukan pada 2020.  Salah satu IKU yang dibahas yaitu Persentase Tingkat Kepatuhan Penyampaian SPT Tahunan PPH Wajib Pajak Badan dan Orang Pribadi. Penetuan Target SPT berdasarkan data antara lain WP Wajib SPT 2019 yang menyampaikan SPT di 2019 dan masih aktif , WP OP Karyawan berpenghasilan dibawah PTKP tapi menyampaikan SPT di 2019 (Non NE-DE) , WP Aktif ada data dan Belum Menyampaikan SPT di 2019, dan WP Baru (Perkiraan 28%). Dengan Rekomendasi Aksi yang dijabarkan juga pada Bimtek ini seperti Mendorong perluasan implementasi KSWP dan Melaksanakan pekan panutan penyampaian SPT bersama para tokoh masyarakat.</p><p><br></p>          ', NULL, 0),
