tukan Karakter). Pelaksanaan diklat tersebut dengan membagi ke\r\ndalam beberapa kelompok dan terdapat role play dan diskusi seluruh peserta untuk\r\nmemberikan pandangan kepada para peserta dalam menghadapi case-case tertentu dan\r\nbagaimana memecahkan masalah. Pada akhir diklat peserta diminta untuk\r\nmengumpulkan action plan yang akan diterapkan di kantor masing masing untuk\r\nmencapai target sesuai IKU. Tidak terdapat kendala pada saat pelaksanaan tugas\r\nini. </span></sup>', NULL, 0),
