(85, '197203061992031001', '199110222013101001', '197203061992031001', '196905311989122001', 'SPD-0082/WPJ.16/KP.02/2020', '2020-01-17', 'Sehubungan dengan Nota Dinas dari Kantor Wilayah DJP Sulawesi Utara, Tengah, Gorontalo dan Maluku Utara nomor ND-204/WPJ.16/2020 tanggal 12 Februari 2020 perihal Undangan Peserta Forum PPIP Kanwil DJP Suluttenggomalut Tahun 2020', 'Angkutan Udara', 2, '2020-02-18', '267', '', '', '', '2020-02-22', '77', '2020-01-17', 370000, 2, 740000, 20, NULL, NULL, NULL, NULL, 592000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 592000, 0, 0, 592000, NULL, 0, '0000-00-00', NULL, '', NULL, '<p class=\"MsoNormal\" xss=removed><sup><span lang=\"IT\">Pelaksanaan\r\nkegiatan Forum Bidang Pemeriksaan, Penagihan, Intelijen dan Penyidikan Tahun\r\n2020 yang diselenggarakan oleh Kanwil DJP Sulawesi Utara, Tengah, Gorontalo dan\r\nMaluku Utara berjalan dengan lancar. Forum tersebut diawali dengan Evaluasi\r\nKinerja Pemeriksaan, Penagihan Tahun 2019. Dalam pemaparan  kali ini disebutkan target dan realisasi pencapaian\r\npada tahun 2019 mulai dari pencairan piutang, extra effort pemeriksaan dan\r\npenagihan, realisasi tindakan penagihan, penyelesaian lhp, rekomendasi strategi\r\npemeriksaan penagihan tahun 2020 dan sebagainya. Setelah evaluasi kegiatan\r\nmateri selanjutnya <i>Comunication Skill</i>\r\ndimana narasumber utama dalam kegiatan ini adalah Bapak Moch Arief Risman beliau\r\nmerupakan Widyaiswara Madya PPSDM BPPK Kemenkeu RI. Beliau menjelaskan mengenai\r\nprinsip-prinsip dalam berkomunikasi, komunikasi dan negosiasi adalah skill yang\r\nsemakin banyak dilatih semakin canggih dan bukan hanya semata-mata bakat. Dengan\r\nadanya materi <i>Comunication Skill</i> ini\r\ntentunya banyak sekali informasi yang didapatkan didapatkan bagaimana\r\nlankah-langkah kedepannya untuk berkomunikasi secara efektif dan efisien khusunya\r\ndengan para wajib pajak dalam penggalian potensi-potensi perpajakan. Pada hari\r\nkedua kegiatan dilanjutkan dengan materi Prosedur Penyitaan aset rekening dari\r\nBankl Mandiri dan Bank Sulut. Pada materi tersebut dijelaskan mengenai tata\r\ncara melakukan pemblokiran rekening wajib pajak, kendala-kendala yang terjadi\r\ndilapangan dalam proses administrasi pemblokiran. Kemudian dilanjutkan dengan materi\r\ndari BPN dan KPKNL, inti dari materi ini bagaimana prosedur Prosedur Penyitaan\r\naset tanah dan bagaimana cara melakukan pelelangan atas harta yang telah disita\r\ndari penanggung pajak. Pada hari terakhir materi tentang Prosedur dan Aspek\r\nHukum Forensik Digital dalam kegiatan Pemeriksaan dilanjutkan <i>dengan Sharing Session </i>Kepala KPP\r\nPratama Bitung diakhir acara seluruh peserta mengikuti Apel Siaga Penegakan\r\nHukum dan Pengarahan dari Bapak Tri Wibowo selaku Kepala Kanwil Sulut Tenggo\r\nMalut diakhiri dengan Penandatangan Fakta Integiritas pencapaian IKU tahun\r\n2020.     <o></o></span></sup></p>                     ', NULL, 0),
(86, '197203061992031001', '199110222013101001', '197203061992031001', '197307201994021001', 'SPD-0083/WPJ.16/KP.02/2020', '2020-01-17', 'Sehubungan dengan Nota Dinas dari Kantor Wilayah DJP Sulawesi Utara, Tengah, Gorontalo dan Maluku Utara nomor ND-204/WPJ.16/2020 tanggal 12 Februari 2020 perihal Undangan Peserta Forum PPIP Kanwil DJP Suluttenggomalut Tahun 2020', 'Angkutan Udara', 2, '2020-02-18', '267', '', '', '', '2020-02-22', '77', '2020-01-17', 370000, 2, 740000, 20, NULL, NULL, NULL, NULL, 592000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 592000, 0, 0, 592000, NULL, 0, '0000-00-00', NULL, '', NULL, '                                Pelaksanaan kegiatan Forum Bidang Pemeriksaan, Penagihan, Intelijen dan Penyidikan Tahun 2020 yang diselenggarakan oleh Kanwil DJP Sulawesi Utara, Tengah, Gorontalo dan Maluku Utara berjalan dengan lancar. Forum tersebut diawali dengan Evaluasi Kinerja Pemeriksaan, Penagihan Tahun 2019. Dalam pemaparan  kali ini disebutkan target dan realisasi pencapaian pada tahun 2019 mulai dari pencairan piutang, extra effort pemeriksaan dan penagihan, realisasi tindakan penagihan, penyelesaian lhp, rekomendasi strategi pemeriksaan penagihan tahun 2020 dan sebagainya. Setelah evaluasi kegiatan materi selanjutnya Comunication Skill dimana narasumber utama dalam kegiatan ini adalah Bapak Moch Arief Risman beliau merupakan Widyaiswara Madya PPSDM BPPK Kemenkeu RI. Beliau menjelaskan mengenai prinsip-prinsip dalam berkomunikasi, komunikasi dan negosiasi adalah skill yang semakin banyak dilatih semakin canggih dan bukan hanya semata-mata bakat. Dengan adanya materi Comunication Skill ini tentunya banyak sekali informasi yang didapatkan didapatkan bagaimana lankah-langkah kedepannya untuk berkomunikasi secara efektif dan efisien khusunya dengan para wajib pajak dalam penggalian potensi-potensi perpajakan. Pada hari kedua kegiatan dilanjutkan dengan materi Prosedur Penyitaan aset rekening dari Bankl Mandiri dan Bank Sulut. Pada materi tersebut dijelaskan mengenai tata cara melakukan pemblokiran rekening wajib pajak, kendala-kendala yang terjadi dilapangan dalam proses administrasi pemblokiran. Kemudian dilanjutkan dengan materi dari BPN dan KPKNL, inti dari materi ini bagaimana prosedur Prosedur Penyitaan aset tanah dan bagaimana cara melakukan pelelangan atas harta yang telah disita dari penanggung pajak. Pada hari terakhir materi tentang Prosedur dan Aspek Hukum Forensik Digital dalam kegiatan Pemeriksaan dilanjutkan dengan Sharing Session Kepala KPP Pratama Bitung diakhir acara seluruh peserta mengikuti Apel Siaga Penegakan Hukum dan Pengarahan dari Bapak Tri Wibowo selaku Kepala Kanwil Sulut Tenggo Malut diakhiri dengan Penandatangan Fakta Integiritas pencapaian IKU tahun 2020.          ', NULL, 0),
