(89, '197203061992031001', '199110222013101001', '197203061992031001', '199209072014111004', 'SPD-0086/WPJ.16/KP.02/2020', '2020-01-17', 'Sehubungan dengan Nota Dinas dari Kantor Wilayah DJP Sulawesi Utara, Tengah, Gorontalo dan Maluku Utara nomor ND-204/WPJ.16/2020 tanggal 12 Februari 2020 perihal Undangan Peserta Forum PPIP Kanwil DJP Suluttenggomalut Tahun 2020', 'Angkutan Udara', 2, '2020-02-18', '267', '', '', '', '2020-02-22', '77', '2020-01-17', 370000, 2, 740000, 20, NULL, NULL, NULL, NULL, 592000, 690400, 657900, 1348300, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 150000, 138000, 138000, 150000, 576000, NULL, 2516300, 0, 0, 2516300, NULL, 0, '0000-00-00', NULL, '', NULL, '<p class=\"MsoNormal\"><span xss=removed>Pelaksanaan kegiatan Forum Bidang P2IP Tahun 2020 yang diselenggarakan oleh Kanwil\r\nDJP Sulawesi Utara, Tengah, Gorontalo dan Maluku Utara berjalan dengan lancar.\r\nForum diawali dengan Evaluasi Kinerja Tahun\r\n2019. Materi selanjutnya Communication Skill dengan Narasumber Bpk Arief Risman (Widyaiswara Madya PPSDM BPPK Kemenkeu).</span></p><p class=\"MsoNormal\"><span xss=removed>Pada hari kedua diberikan materi mengenai pembuatan dan kriteria Usulan IDLP. Selanjutnya dilakukan pemaparan usulan IDLP dari masing-masing KPP di wilayah Kanwil DJP Suluttenggomalut.</span></p><p class=\"MsoNormal\"><span xss=removed>Pada hari ketiga diberikan materi mengenai Forensic Digital, dan Sharing Session oleh Kepala KPP Pratama Bitung, Marasi Napitupulu. Forum Bidang P2IP kemudian ditutup dengan Apel Siaga Kanwil DJP Suluttenggomalut dan komitmen pencapaian IKU Tahun 2020</span></p><p class=\"MsoNormal\"><span xss=removed><br></span></p><p class=\"MsoNormal\"><span xss=removed><br></span></p><p class=\"MsoNormal\" xss=removed><o></o></p>', NULL, 0);
