(100, '197203061992031001', '199110222013101001', '197203061992031001', '197203061992031001', 'SPD-0097/WPJ.16/KP.02/2020', '2020-01-18', 'Sehubungan dengan Nota Dinas dari Kantor Wilayah DJP Sulawesi Utara, Tengah, Gorontalo dan Maluku Utara nomor ND-233/WPJ.16/2020 tanggal 18 Februari 2020 perihal Undangan Peserta PPIP Kanwil DJP Suluttenggomalut Tahun 2020', 'Angkutan Udara', 3, '2020-02-20', '267', '', '', '', '2020-02-22', '83', '2020-01-18', 370000, 3, 1110000, 20, NULL, NULL, NULL, NULL, 888000, 651900, 657900, 1309800, 1, '2020-02-20', '2020-02-21', 700000, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 700000, 0, 138000, 138000, 0, 276000, NULL, 3173800, 0, 0, 3173800, NULL, 0, '0000-00-00', NULL, '', NULL, '<p>                      Penugasan adalah untuk menghadiri bimbingan teknis terkait forensik audit yang dilaksanakan di Hotel Arya Duta Mando dengan penyelenggara Bidang P2IP Kanwil DJP Sulawesi Utara, Sulawesi Tengah, Gorontalo dan Maluku Utara.</p><p>Pelaksanaan bimtek merupakan rangkaian dari pelaksanaan bimbingan teknis penegakan hukum, dan di hari terakhir kepala kantor dihadirkan untuk ikut mempelajari hal-hal teknis terkait Forensik Audit. Dalam kesempatan tersebut selain dipaparkan hal-hal konsep dan aturan maupun teknikal dasar forensik audit, juga dilakukan sharing session yang disampaikan oleh Kepala KPP Bitung sebagai nara sumber.</p><p>pembelajaran utama dalam bimbingan teknis tersebut adalah sebagai berikut:</p><p>1. teknik Forensik audit adalah salah satu cara untuk meningkatkan kualitas pemeriksaan.</p><p>2. selain fornsik audit hal lain yang juga menjadi faktor kunci keberhasilan pemeriksaan adalah kemampuan auditor melakukan BAPK dan ketrampilan komunikasi Skill</p><p>3. di setiap KPP sudah terdapat pegawai yang telah mengikuti pendidikan sebagai Forensor</p><p>4. Pengalaman lapangan dengan kasus riil diperlukan untuk meningkatkan kemampuan SDM di masing2 KPP<br>                    </p>', NULL, 0),
