ihe dengan ini disampaikan Laporan Pelaksanaan Tugas sebagai\r\nberikut:</span></p><p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Sasaran dari kegiatan ini adalah Tim Pemeriksa bertemu\r\ndengan Wajib Pajak/Wakil</span><span xss=\"removed\"> </span><span xss=\"removed\">dan melaksanakan administrasi\r\nsehubungan dengan pemeriksaan yaitu pengujian langsung di tempat Wajib Pajak.</span>\r\n\r\n</p>\r\n\r\n<p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Tim Pemeriksa melakukan perjalanan ke alamat Wajib\r\nPajak. Wajib Pajak bertemu dengan Fatma Badu yang beralamat di Jl Pelabuhan\r\nAnggrek, Pontolo, Gorontalo Utara. Kemudian Tim Pemeriksa melakukan perjalanan\r\nke alamat Eron Bobihe yang beralamat di Jl. Beringin II Lingkungan I, Kayubulan\r\nLimboto, Kab. Gorontalo. Tim Pemeriksa bertemu dengan Eron Bobihe.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Tidak terdapat kendala dalam pelaksanaan tugas.</span></p>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" xss=\"removed\"><span xss=\"removed\">Kegiatan pengujian lapangan di tempat Wajib Pajak\r\ntelah dilaksanakan dengan baik. </span><span xss=\"removed\" lang=\"IN\">Tim Pemeriksa</span><span xss=\"removed\"> telah\r\nbertemu secara langsung oleh Wajib Pajak/wakil WP dan</span><span xss=\"removed\"> </span><span xss=\"removed\">menunggu dokumen yang diminta pada saat pertemuan untuk disampaikan ke\r\nKPP</span><span xss=\"removed\" lang=\"IN\">.</span><span xss=\"removed\"></span></p>\r\n\r\n                                        ', NULL, 0),
