moved>Sasaran dari kegiatan ini adalah Tim Pemeriksa bertemu\r\ndengan Wajib Pajak/Wakil</span><span xss=removed> </span><span xss=removed>dan melaksanakan administrasi\r\nsehubungan dengan pemeriksaan yaitu pengujian langsung di tempat Wajib Pajak.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><sup><span xss=removed> </span></sup></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Tim Pemeriksa melakukan perjalanan ke alamat Wajib\r\nPajak. Wajib Pajak bertemu dengan wakil dari SMP Muh. Batudaa yang beralamat di\r\nJl Hasanudin No.208, Batudaa, Payunga, Batudaa, Kab.Gorontalo. Tim Pemeriksa\r\nbertemu dengan Robiana H. Biahimo selaku bendahara SMP Muh. Batudaa.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Tidak terdapat kendala dalam pelaksanaan tugas.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Kegiatan pengujian lapangan di tempat Wajib Pajak\r\ntelah dilaksanakan dengan baik. </span><span xss=removed lang=\"IN\">Tim Pemeriksa</span><span xss=removed> telah\r\nbertemu secara langsung oleh Wajib Pajak/wakil WP dan</span><span xss=removed> </span><span xss=removed>menunggu dokumen yang diminta pada saat pertemuan untuk disampaikan ke\r\nKPP</span><span xss=removed lang=\"IN\">.</span><span xss=removed></span></p>\r\n\r\n', NULL, 0),
(262, '197203061992031001', '199110222013101001', '196905311989122001', '197411181994032001', 'SPD-00143/WPJ.16/KP.02/2020', '2020-03-06', 'Dalam rangka menghadiri Undangan Sosialisasi dan Bimbingan Teknis Kebijakan Pengawasan dan Pemeriksaan Wajib Pajak sehubungan dengan Perluasan Basis Pajak sesuai Nota Dinas UND-63/PJ.01/2020 tanggal 04 Maret 2020', 'Angkutan Udara', 2, '2020-03-09', 'Makassar', '', '', '', '2020-03-18', '130', '2020-03-06', 430000, 2, 860000, 20, NULL, NULL, NULL, NULL, 688000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 592000, 0, 0, 592000, NULL, 0, '0000-00-00', NULL, '', NULL, '                                 <p>           Melaksanakan kegiatan pelatihan dasar CPNS Kementerian Keuangan Periode II Golongan II di Balai Diklat Keuangan Manado.</p><p>Pelaksanaan dari kegiatan tersebut berupa penerapan prinsip bela negara dan nasionalisme serta penerapan nilai-nilai Kementerian Keuangan dan nilai-nilai ANEKA.</p><p>Kendala dari pelaksanaan kegiatan pelatihan dasar tersebut adalah mewabahnya virus COVID-19 sehingga berpengaruh juga terhadap keputusan penyelenggaraan pelatihan dasar di Balai Diklat tersebut. Adapun solusinya yaitu dipulangkannya siswa menuju instansi tempat mereka masing-masing bekerja mulai tanggal 18 Maret 2020, tepat seminggu setelah pelaksanaan kegiatan pelatihan dasar digelar. Selanjutnya, kegiatan pelatihan dasar CPNS Kementerian Keuangan Periode II Golongan II dilaksanakan secara online melalui aplikasi pihak ketiga, yaitu zoom.</p><p>Pelaksanaan kegiatan pelatihan dasar tersebut merupakan sebuah hal yang penting, di mana kegiatan tersebut diharapkan menjadi pondasi dalam melaksanakan kewajiban di masing-masing instansi agar sesuai dengan nilai-nilai di Kementerian Keuangan </p>                              ', NULL, 0),
