(266, '197203061992031001', '199110222013101001', '197411181994032001', '199502042018011003', 'SPD-00147/WPJ.16/KP.02/2020', '2020-03-09', 'Dalam rangka Asistensi Efilling di Polres Gorontalo', 'Angkutan Darat', 1, '2020-03-09', 'Kab. Gorontalo', '', '', '', '2020-03-14', '136', '2020-03-09', 200000, 1, 200000, 20, NULL, NULL, NULL, NULL, 160000, 697000, 697000, 1394000, 5, '2020-03-09', '2020-03-14', 604672, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 3023360, 0, 0, 0, 0, 0, NULL, 5105360, 5917360, 0, -812000, NULL, 0, '0000-00-00', NULL, '', NULL, '           <p>                                          Sosialisasi dan Bimbingan Teknis tentang Kebijakan Pengawasan dan Pemeriksaan dalam rangka Perluasan Basis Pajak yang diselenggarakan di Gedung Keuangan II Makassat telah berjalan dengan baik dan lancar. Materi yang disampaikan adalah sebagai berikut :</p><p>1. Overview Surat Edaran dan Proses Bisnis Pengawasan WP Strategis.</p><p>2. Proses Bisnis Pengawasan WP Lainnya dan KPDL.</p><p>3. LHPt dan KKPt.</p><p>4. CRM.</p><p>5. Analisis Laporan Keuangan dan SPT Tahunan.</p><p>6. Transfer Pricing.</p><p>7. Analisis Data internal & eksternal DJP.</p><p>8. Aspek Perpajakan Internasional.<br></p><p><br></p>          ', NULL, 0),
