(275, '197203061992031001', '199110222013101001', '197307201994021001', '197906022000121002', 'SPD-00156/WPJ.16/KP.02/2020', '2020-03-09', 'Dalam rangka melaksanakan perintah pemeriksaan lapangan pengukuhan PKP secara jabatan', 'Angkutan Darat', 1, '2020-03-09', 'Kab. Gorontalo', '', '', '', '2020-03-09', '131', '2020-03-06', 200000, 1, 200000, 20, NULL, NULL, NULL, NULL, 160000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 160000, 0, 0, 160000, NULL, 0, '0000-00-00', NULL, '', NULL, '<div>Jenis Kegiatan:</div><div>Melaksanakan Penyampaian SP kepada Wajib Pajak</div><div>Hasil Kegiatan:</div><div>Surat Paksa tersampaikan</div><div><br></div><div>Kendala:</div><div>1.<span xss=removed> </span>WP tidak ditemukan di lokasi kerja, di lokasi kerja juga bukan merupakan pegawai tetap, oleh karena itu harus mencari rumah Wajib Pajak tersebut disebabkan tidak adanya data/informasi alamat rumah Wajib Pajak.</div><div>Solusi:</div><div>1.<span xss=removed> </span>Selalu koordinasi dan updateatau tagging alamat Wajib Pajak.</div><div>Kesimpulan:</div><div>Surat Tugas sudah dilaksanakan sesuai dengan perintah.</div>', NULL, 0),
