(296, '197203061992031001', '199110222013101001', '197912212001121003', '198503282007011001', 'SPD-00168/WPJ.16/KP.02/2020', '2020-03-09', 'Dalam rangka penyisiran wajib pajak di kecamatan telaga', 'Angkutan Darat', 3, '2020-03-10', '129', '', '', '', '2020-03-12', '139', '2020-03-09', 200000, 3, 600000, 20, NULL, NULL, NULL, NULL, 480000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 480000, 0, 0, 480000, NULL, 0, '0000-00-00', NULL, '', NULL, 'Pelaksanaan Kegiatan Dilakukan di daerah Bulila, Kecamatan telaga Kab.Gorontalo. Petugas berhasil menemui 12 Wajib Pajak dan melakukan input data aplikasi Pinogu. Dari 12 WP yang dikunjungi, terdapat 4 WP yang mengisi SPT, 3 WP sudah Lapor dan bayar, 5 WP berkomitmen untuk datang langsung ke Kantor. kendala yang dihadapi, alamat WP tidak sesuai dengan database, waktu kunjungan bersamaan dengan waktu sibuk WP sehingga WP tidak berada di rumah.', NULL, 0),
(297, '197203061992031001', '199110222013101001', '197912212001121003', '198503092006021002', 'SPD-00169/WPJ.16/KP.02/2020', '2020-03-09', 'Dalam rangka penyisiran wajib pajak di kecamatan telaga', 'Angkutan Darat', 3, '2020-03-10', '129', '', '', '', '2020-03-12', '140', '2020-03-09', 200000, 3, 600000, 20, NULL, NULL, NULL, NULL, 480000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 480000, 0, 0, 480000, NULL, 0, '0000-00-00', NULL, '', NULL, '                      Pelaksanaan Kegiatan Dilakukan di daerah Bulila, Kecamatan telaga Kab.Gorontalo. Petugas berhasil menemui 12 Wajib Pajak dan melakukan input data aplikasi Pinogu. Dari 12 WP yang dikunjungi, terdapat 4 WP yang mengisi SPT, 3 WP sudah Lapor dan bayar, 5 WP berkomitmen untuk datang langsung ke Kantor. kendala yang dihadapi, alamat WP tidak sesuai dengan database, waktu kunjungan bersamaan dengan waktu sibuk WP sehingga WP tidak berada di rumah.                                         ', NULL, 0),
(298, '197203061992031001', '199110222013101001', '197207041992121001', '198010072000021001', 'SPD-00170/WPJ.16/KP.02/2020', '2020-03-09', 'Dalam rangka penyisiran wajib pajak di kecamatan telaga', 'Angkutan Darat', 3, '2020-03-10', '129', '', '', '', '2020-03-12', '140', '2020-03-09', 200000, 3, 600000, 20, NULL, NULL, NULL, NULL, 480000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 480000, 0, 0, 480000, NULL, 0, '0000-00-00', NULL, '', NULL, '<sup><span xss=\"removed\">1. Kegiatan penyisiran/canvassing di wilayah Kecamatan Telaga ,Kab.Gorontalo kepada para Wajib Pajak yang telah terdaftar namun belum melaporkan SPT Tahunan PPh ;</span></sup><p><sup><span xss=\"removed\">2. Dari hasil pelaksanaan tugas ini, dapat diketahui lokasi usaha dan gambaran usaha Wajib Pajak yang menjadi sasaran canvassing . Selain itu, dilakukan pendampingan kepada Wajib Pajak dalam pengisian SPT   Tahunan , pembuatan kode billing, dan prosedur permohonan Non Efektif (NE);</span></sup></p><p><sup><span xss=\"removed\">3. Adapun kendala dalam pelaksanaan tugas adalah terdapat beberapa wajib pajak yang tidak dapat ditemukan karena alamat wajib pajak yang tidak lengkap atau wajib pajak sudah pindah domisili;</span></sup></p><p><sup><span xss=\"removed\"><br></span></sup></p><p><sup><span xss=\"removed\"><br></span></sup></p>          ', NULL, 0),
(299, '197203061992031001', '199110222013101001', '197912212001121003', '198403032003121002', 'SPD-00171/WPJ.16/KP.02/2020', '2020-03-09', 'Dalam rangka penyisiran wajib pajak di kecamatan telaga', 'Angkutan Darat', 3, '2020-03-10', '129', '', '', '', '2020-03-12', '141', '2020-03-09', 200000, 3, 600000, 20, NULL, NULL, NULL, NULL, 480000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 480000, 0, 0, 480000, NULL, 0, '0000-00-00', NULL, '', NULL, '           <p>                     1. Kegiatan penyisiran/canvassing di wilayah Kecamatan Telaga, Kab. Gorontalo kepada para Wajib Pajak yang telah terdaftar namun belum melaporkan SPT Tahunan PPh.</p><p>2. Dari hasil pelaksanaan tugas ini, dapat diketahui lokasi usaha dan gambaran usaha Wajib Pajak yang menjadi sasaran canvassing. Selain itu, dilakukan pendampingan kepada Wajib Pajak dalam pengisian SPT Tahunan PPh, pembuatan kode e-billing, dan prosedur permohonan Non Efektif (NE).</p><p>3. Adapun kendala dalam pelaksanaan tugas adalah terdapat beberapa Wajib Pajak yang tidak dapat ditemukan karena alamat Wajib Pajak yang tidak lengkap atau sudah pindah domisili.<br></p>          ', NULL, 0),
