(306, '197203061992031001', '199110222013101001', '197203061992031001', '199501092015021006', 'SPD-00178/WPJ.16/KP.02/2020', '2020-03-11', 'Dalam rangka Pelaksanaan Bimbingan Teknis Pengelolaan Kinerja dan Sosialisasi Manual IKU Unit Vertikal DJP Tahun 2020 sesuai Nota Dinas Kepala Kantor Wilayah Suluttenggomalut nomor ND-328/WPJ.16/KP.02/2020 tanggal 10 Maret 2020', 'Angkutan Darat', 4, '2020-03-11', '155', '', '', '', '2020-03-14', '145', '2020-03-10', 530000, 4, 2120000, 20, NULL, NULL, NULL, NULL, 1696000, 952200, 0, 952200, 2, '2020-03-11', '2020-03-13', 711207, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 1422414, 100000, 150000, 0, 0, 250000, NULL, 4320614, 2374614, 0, 1946000, NULL, 0, '0000-00-00', NULL, '', NULL, '           Telah dilaksanakan tugas memenuhi undangan Kepala Kanwil DJP Suluttenggo dan Malut Nomor ND-328/WPJ.16/KP.02/2020 tanggal 10 Maret 2020 tentang Pelaksanaan Bimbingan Teknis Pengelolaan Kinerja dan Sosialisasi Manual IKU Unit Vertikal DJP Tahun 2020 melalui Surat Tugas ini. Pada Bimtek yang diadakan di Kanwil DJP Jakarta Utara ini, dihadiri dari Bagian Organisasi dan Tata Laksana, Direktorat Potensi Kepatuhan dan Penerimaan, dan Direktorat Ekstensifikasi Penilaian. Peserta yang hadir adalah MMKO dan AKO dari Kanwil DJP Bengkulu dan Lampung , Kanwil DJP Sumatera Selatan dan Kepulauan Bangka Belitung, Kanwil DJP Suluttenggo dan Malut , dan Kanwil DJP Jakarta Utara.<br>Pada Hari pertama Kamis 12 Maret 2020, materi yang diberikan adalah mengenai pengelolaan kinerja. Tidak ada perubahan untuk pengelolaan kinerja masih menggunakan aturan PER-12/PJ/2018 tentang Pengelolaan Kinerja di Lingkungan DJP dan KMK-467/KMK.01/2014 tentang Pengelolaan Kinerja di Lingkungan Kemenkeu, dan perubahannya (KMK-556/KMK.01/2015). Materi yang diajarkan antara lain Peta Konsep Penurunan Visi dan Misi Kemenkeu ke Renstra DJP 2020-2024 lalu Renja DJP 2020 lalu dijabarkan ke Sasaran Strategis yang dianalisis melalui Manajemen Risiko lalu dilakukan upaya mitigasi melalui Inisiatif Strategis dan selanjutnya masuk ke Pengelolaan Kinerja yang didalamnya ada IKU yang digunakan sebagai indikator capaian Sasaran Strategis dan Alat untuk mencapai Inisiatif Strategis. IKU akan dibahas pada DKO dengan alur berputar antara planning, managing, dan evaluating sesuai KMK-590/KMK.01/2016, KMK-467/KMK.01/2014, dan PP-46/2011 yang hasilnya berupa NKO untuk organisasi dan NKP (E-performance) dan NPKPNS (Sikka) untuk individu. Selain itu diberikan materi sekilas mengenai Strategi, Balance Scorecard, Peta Strategi Kemenkeu, Sasaran Strategis, Indikator Kinerja Utama,  Manual IKU, NKO, dan Kontrak Kinerja.<br>Pada Hari kedua Jumat 13 Maret 2020, materi yang diberikan adalah mengenai Manual IKU 2020 dan  perubahan-perubahan significant IKU yang dilakukan pada 2020.  Salah satu IKU yang dibahas yaitu Persentase Tingkat Kepatuhan Penyampaian SPT Tahunan PPH Wajib Pajak Badan dan Orang Pribadi. Penetuan Target SPT berdasarkan data antara lain WP Wajib SPT 2019 yang menyampaikan SPT di 2019 dan masih aktif , WP OP Karyawan berpenghasilan dibawah PTKP tapi menyampaikan SPT di 2019 (Non NE-DE) , WP Aktif ada data dan Belum Menyampaikan SPT di 2019, dan WP Baru (Perkiraan 28%). Dengan Rekomendasi Aksi yang dijabarkan juga pada Bimtek ini seperti Mendorong perluasan implementasi KSWP dan Melaksanakan pekan panutan penyampaian SPT bersama para tokoh masyarakat.                                                    ', NULL, 0),
(307, '197203061992031001', '199110222013101001', '197410171995112001', '199309052013101001', 'SPD-00179/WPJ.16/KP.02/2020', '2020-03-11', 'Dalam rangka membantu melaksanakan penilaian lapangan an PT Puncak Emas Tani Sejahtera dan PT Pani Bersama Tambang', 'Angkutan Darat', 3, '2020-03-11', '361', '', '', '', '2020-03-14', '146', '2020-03-10', 370000, 3, 1110000, 20, NULL, NULL, NULL, NULL, 888000, 963200, 952200, 1915400, 3, '2020-03-11', '2020-03-12', 711540, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 2134620, 150000, 150000, 150000, 150000, 600000, NULL, 6346020, 0, 0, 6346020, NULL, 0, '0000-00-00', NULL, '', NULL, '           <p>Telah dilaksanakan tugas memenuhi undangan Kepala Kanwil DJP Suluttenggo dan Malut Nomor ND-328/WPJ.16/KP.02/2020 tanggal 10 Maret 2020 tentang Pelaksanaan Bimbingan Teknis Pengelolaan Kinerja dan Sosialisasi Manual IKU Unit Vertikal DJP Tahun 2020 melalui Surat Tugas ini. Pada Bimtek yang diadakan di Kanwil DJP Jakarta Utara ini, dihadiri dari Bagian Organisasi dan Tata Laksana, Direktorat Potensi Kepatuhan dan Penerimaan, dan Direktorat Ekstensifikasi Penilaian. Peserta yang hadir adalah MMKO dan AKO dari Kanwil DJP Bengkulu dan Lampung , Kanwil DJP Sumatera Selatan dan Kepulauan Bangka Belitung, Kanwil DJP Suluttenggo dan Malut , dan Kanwil DJP Jakarta Utara.</p><p>Pada Hari pertama Kamis 12 Maret 2020, materi yang diberikan adalah mengenai pengelolaan kinerja. Tidak ada perubahan untuk pengelolaan kinerja masih menggunakan aturan PER-12/PJ/2018 tentang Pengelolaan Kinerja di Lingkungan DJP dan KMK-467/KMK.01/2014 tentang Pengelolaan Kinerja di Lingkungan Kemenkeu, dan perubahannya (KMK-556/KMK.01/2015). Materi yang diajarkan antara lain Peta Konsep Penurunan Visi dan Misi Kemenkeu ke Renstra DJP 2020-2024 lalu Renja DJP 2020 lalu dijabarkan ke Sasaran Strategis yang dianalisis melalui Manajemen Risiko lalu dilakukan upaya mitigasi melalui Inisiatif Strategis dan selanjutnya masuk ke Pengelolaan Kinerja yang didalamnya ada IKU yang digunakan sebagai indikator capaian Sasaran Strategis dan Alat untuk mencapai Inisiatif Strategis. IKU akan dibahas pada DKO dengan alur berputar antara planning, managing, dan evaluating sesuai KMK-590/KMK.01/2016, KMK-467/KMK.01/2014, dan PP-46/2011 yang hasilnya berupa NKO untuk organisasi dan NKP (E-performance) dan NPKPNS (Sikka) untuk individu. Selain itu diberikan materi sekilas mengenai Strategi, Balance Scorecard, Peta Strategi Kemenkeu, Sasaran Strategis, Indikator Kinerja Utama,  Manual IKU, NKO, dan Kontrak Kinerja.</p><p>Pada Hari kedua Jumat 13 Maret 2020, materi yang diberikan adalah mengenai Manual IKU 2020 dan  perubahan-perubahan significant IKU yang dilakukan pada 2020.  Salah satu IKU yang dibahas yaitu Persentase Tingkat Kepatuhan Penyampaian SPT Tahunan PPH Wajib Pajak Badan dan Orang Pribadi. Penetuan Target SPT berdasarkan data antara lain WP Wajib SPT 2019 yang menyampaikan SPT di 2019 dan masih aktif , WP OP Karyawan berpenghasilan dibawah PTKP tapi menyampaikan SPT di 2019 (Non NE-DE) , WP Aktif ada data dan Belum Menyampaikan SPT di 2019, dan WP Baru (Perkiraan 28%). Dengan Rekomendasi Aksi yang dijabarkan juga pada Bimtek ini seperti Mendorong perluasan implementasi KSWP dan Melaksanakan pekan panutan penyampaian SPT bersama para tokoh masyarakat.</p><p><br></p>          ', NULL, 0),
