ni adalah Tim Pemeriksa bertemu\r\ndengan Wajib Pajak/Wakil</span><span xss=removed> </span><span xss=removed>dan melaksanakan administrasi\r\nsehubungan dengan pemeriksaan yaitu pengujian langsung di tempat Wajib Pajak.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><sup><span xss=removed> </span></sup></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Tim Pemeriksa melakukan perjalanan ke alamat Wajib\r\nPajak di Jl Jend. Sudirman No.63, Limboto, Kab.Gorontalo. Tim Pemeriksa bertemu\r\ndengan wakil PDAM Kab. Gorontalo di Limboto. Tim Pemeriksa bertemu dengan\r\nSalfian Rivo Hiola selaku Direktur. Tim Pemeriksa tidak dapat menemui Wajib\r\nPajak Sukarno Wibowo karena alamat yang tertera pada SIDJP sudah tidak\r\nditempati oleh Wajib Pajak.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Tidak terdapat kendala dalam pelaksanaan tugas.</span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed> </span></p>\r\n\r\n<p class=\"MsoNormal\" xss=removed><span xss=removed>Kegiatan pengujian lapangan di tempat Wajib Pajak\r\ntelah dilaksanakan dengan baik. </span><span xss=removed lang=\"IN\">Tim Pemeriksa</span><span xss=removed> telah\r\nbertemu secara langsung oleh Wajib Pajak/wakil WP dan</span><span xss=removed> </span><span xss=removed>menunggu dokumen yang diminta pada saat pertemuan untuk disampaikan ke\r\nKPP</span><span xss=removed lang=\"IN\">.</span><span xss=removed></span></p>\r\n\r\n', NULL, 0),
(317, '197203061992031001', '199110222013101001', '197203061992031001', '199206112014111007', 'SPD-00189/WPJ.16/KP.02/2020', '2020-03-11', 'Dalam rangka melakukan pengujian lapangan di tempat Wajib Pajak sesuai Surat Perintah Pemeriksaan', 'Angkutan Darat', 1, '2020-03-12', '129', '', '', '', '2020-03-12', '157', '2020-03-11', 200000, 1, 200000, 20, NULL, NULL, NULL, NULL, 160000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 160000, 0, 0, 160000, NULL, 0, '0000-00-00', NULL, '', NULL, '           &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><font face=\"Arial\"><span xss=\"removed\">Sehubungan dengan Surat Tugas Nomor\r\nST-0157/WPJ.16/KP.02/2020</span><span lang=\"EN-US\" xss=\"removed\">\r\ntanggal 11 Maret 2020 tentang tugas pengujian lapangan di tempat Wajib Pajak PDAM Kab. Gorontalo dan Sukarno Wibowo.</span></font></p><font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\"><font face=\"Arial\"> </font></span></p><font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><font face=\"Arial\"><span lang=\"EN-US\" xss=\"removed\">Sasaran dari kegiatan ini adalah Tim\r\nPemeriksa bertemu dengan Wajib Pajak</span><span lang=\"EN-US\" xss=\"removed\"> </span><span lang=\"EN-US\" xss=\"removed\">dan melaksanakan pengujian lapangan di tempat Wajib Pajak.</span></font></p><font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><sup><span lang=\"EN-US\" xss=\"removed\"><font face=\"Arial\"> </font></span></sup></p><font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\"><font face=\"Arial\">Tim Pemeriksa melakukan perjalanan ke\r\nalamat Wajib Pajak di Jalan Jend. Sudirman No. 63, Limboto, Kab. Gorontalo dan Jalan Beringin II No. 178, Limboto, Kab. Gorontalo. Wajib Pajak\r\nbertemu dengan wakil PDAM Kab. Gorontalo di Limboto. Tim Pemeriksa bertemu dengan\r\nSalfian Rivo Hiola selaku Direktur. Tim Pemeriksa Pajak tidak dapat menemui Wajib Pajak Sukarno Wibowo karena alamat yang tertera pada SIDJP sudah tidak ditempati oleh Wajib Pajak.</font></span></p><font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\"><font face=\"Arial\"> </font></span></p><font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\"><font face=\"Arial\">Tidak terdapat kendala dalam pelaksanaan\r\ntugas.</font></span></p><font face=\"Times New Roman\">\r\n\r\n</font><p xss=\"removed\"><span lang=\"EN-US\" xss=\"removed\"><font face=\"Arial\"> </font></span></p><font face=\"Times New Roman\">\r\n\r\n</font><span lang=\"EN-US\" xss=\"removed\">Kegiatan pengujian lapangan kepada Wajib Pajak\r\ntelah dilaksanakan dengan baik. </span><span xss=\"removed\">Tim Pemeriksa</span><span lang=\"EN-US\" xss=\"removed\"> telah bertemu secara langsung oleh Wakil Wajib Pajak</span><span lang=\"EN-US\" xss=\"removed\">.</span>          ', NULL, 0),
(318, '197203061992031001', '199110222013101001', '197203061992031001', '197906022000121002', 'SPD-10009/WPJ.16/KP.02/2020 ', '2020-03-11', 'Dalam rangka Pekan Panutan dan Pojok Pajak di Kantor Gubernur Gorontalo', 'Angkutan Darat', 1, '2020-03-12', '130', '', '', '', '2020-03-12', '156', '2020-03-11', 100000, 1, 100000, 0, NULL, NULL, NULL, NULL, 100000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 160000, 0, 0, 160000, NULL, 0, '0000-00-00', NULL, '', NULL, '<p class=\"MsoNormal\" xss=removed><span xss=removed>Sehubungan dengan Surat Tugas Nomor\r\nST-157</span><span xss=removed>/WPJ.16/KP.0</span><span lang=\"EN-US\" xss=removed>2</span><span xss=removed>/20</span><span lang=\"EN-US\" xss=removed><span xss=removed>20\r\ntanggal 11 Maret 2020 tentang tugas pengujian lapangan di tempat Wajib Pajak atas\r\nnama PDAM Kabupaten Gorontalo dan Sukarno Wibowo, dengan ini disampaikan Laporan\r\nPelaksanaan Tugas sebagai berikut:</span><o></o></span></p><span xss=removed>\r\n\r\n</span><p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Sasaran dari kegiatan ini adalah Tim\r\nPemeriksa bertemu dengan Wakil Wajib Pajak</span><span lang=\"EN-US\" xss=removed> </span><span lang=\"EN-US\" xss=removed>dan melaksanakan administrasi sehubungan dengan\r\npemeriksaan yaitu melaksanakan pengujian lapangan di tempat Wajib Pajak.</span></p><span xss=removed>\r\n\r\n</span><p class=\"MsoNormal\" xss=removed><span xss=removed>Tim Pemeriksa melakukan perjalanan ke\r\nalamat Wajib Pajak di Jalan Jend Sudirman No 63, Hutuo, Limboto, Kab. Gorontalo. Wajib Pajak\r\nbertemu dengan wakil PDAM Kab. Gorontalo di Limboto. Tim Pemeriksa bertemu dengan Salfian Rivo Hiola selaku direktur. Tim Pemeriksa Pajak tidak dapat menemui Wajib Pajak Sukarno Wibowo karena alamat yang tertera pada SIDJP sudah tidak ditempati oleh Wajib Pajak.</span></p><span xss=removed>\r\n\r\n</span><p class=\"MsoNormal\" xss=removed><span xss=removed>Tidak terdapat kendala dalam pelaksanaan\r\ntugas.</span></p><span xss=removed>\r\n\r\n</span><p class=\"MsoNormal\" xss=removed><span lang=\"EN-US\" xss=removed>Kegiatan pengujian lapangan di tempat Wajib Pajak telah dilaksanakan dengan baik. </span><span xss=removed>Tim Pemeriksa</span><span lang=\"EN-US\" xss=removed> telah bertemu secara langsung oleh wakil Wajib Pajak.</span></p>', NULL, 0),
(319, '197203061992031001', '199110222013101001', '197203061992031001', '199502042018011003', 'SPD-10010/WPJ.16/KP.02/2020 ', '2020-03-11', 'Dalam rangka Pekan Panutan dan Pojok Pajak di Kantor Gubernur Gorontalo', 'Angkutan Darat', 1, '2020-03-11', '130', '', '', '', '2020-03-11', '156', '2020-03-11', 100000, 1, 100000, 0, NULL, NULL, NULL, NULL, 100000, 0, 0, 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, '0000-00-00', '0000-00-00', 0, 0, 0, 0, 0, 0, 0, NULL, 100000, 0, 0, 100000, NULL, 0, '0000-00-00', NULL, '', NULL, '<p>Melakukan Asistensi Pelaporan SPT Tahunan (Efilling) di Kantor Gubernur Gorontalo.</p><p>Hasil kegiatan adalah membantu dan mengedukasi pegawai di lingkungan Kantor Gubernur Gorontalo terkait mudahnya Pelaporan SPT Tahunan jika dilakukan secara online agar tahun depan mereka dapat melaporkan secara mandiri.</p><p>Pelaksanaan Surat Tugas telah dilaksanakan sesuai perintah.</p>', NULL, 0),
